import React from "react";
import {
  Link,
  withRouter
} from "react-router-dom";
import ReactTooltip from 'react-tooltip'

function Header(props) {
  function handleLogout(){
    localStorage.clear()
    props.history.push('/')
  }

  return (
    <div className="topo">
    <ReactTooltip place="right" type="dark" effect="solid"/>
      <p>Seja bem-vindo: Usuário</p>
        <div className="menuTopo right">
            <Link to="/a" data-tip="Configurações" data-place="left" data-effect="solid"><i class="tail material-icons white-text">settings</i></Link>
            &nbsp;&nbsp;
            <Link to="/app" data-tip="Atualizar Sistema" data-place="right" data-effect="solid"><i class="tail material-icons white-text">settings_backup_restore</i></Link>
        </div>
    </div>
  );
}

export default withRouter(Header);
